import React, { useState } from "react";

function TableCom({ value }) {
  const [TableData, SetTableData] = useState([]);
  if (value) {
    SetTableData(value);
    return TableData.map((value, index) => {
      return (
        <tr key={index}>
          <td>{value.id}</td>
          <td>{value.name}</td>
          <td>{value.email}</td>
          <td>{value.address.street}</td>
          <td>{value.phone}</td>
        </tr>
      );
    });
  } else {
    return <tr rowspan="5">Click The Button</tr>;
